import React, { useState, useEffect } from 'react';
import { MapPin, Search, Download, Settings } from 'lucide-react';

const ARGODashboard = () => {
  const [floats, setFloats] = useState([]);
  const [filteredFloats, setFilteredFloats] = useState([]);
  const [selectedFloat, setSelectedFloat] = useState(null);
  const [loading, setLoading] = useState(false);
  const [queryInput, setQueryInput] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);

  // Mock data for demonstration - replace with your backend API calls
  const mockFloats = [
    { id: '1900371', latitude: 18.63333333333333, longitude: 70.11666666666667, temperature: 31.7000018536647, salinity: 36.3266239807419, pressure: 6.10000006149612, measurement_time: '2024-06-07T06:39:38', distance_km: 294.679107993077 },
    { id: '1900372', latitude: 17.799999999999, longitude: 70.3999999999997, temperature: 31.8000018536508, salinity: 36.3064783036078, pressure: 0.400000005960465, measurement_time: '2024-06-07T14:00:32', distance_km: 311.506170659206 },
    { id: '7900136', latitude: 16.7967, longitude: 68.8206433333333, temperature: 31.2669969254807, salinity: 36.4256668377414, pressure: 2.90000009871318, measurement_time: '2024-06-07T13:26:33', distance_km: 497.881450367502 },
    { id: '5903394', latitude: 18.0833333333333, longitude: 64.6166666666667, temperature: 31.9639954706117, salinity: 36.7516999136779, pressure: 0.200000002960224, measurement_time: '2024-06-07T14:00:33', distance_km: 824.582847144168 },
    { id: '2903306', latitude: 17.8625, longitude: 67.716336, temperature: 31.5926554120117, salinity: 36.4982185110349, pressure: 4.39999942779541, measurement_time: '2024-06-07T03:06:33', distance_km: 580.832636592665 },
    { id: '7900118', latitude: 16.9166666666667, longitude: 67.3999999999997, temperature: 31.4100003820208, salinity: 36.6079947708943, pressure: 0.600000005960465, measurement_time: '2024-06-07T14:06:49', distance_km: 649.839002713477 },
    { id: '5900514', latitude: 15.8173333333001, longitude: 67.9435416666667, temperature: 31.3044397619209, salinity: 36.4711000671392672, pressure: 5.60000009536743, measurement_time: '2024-06-01T07:02:21', distance_km: 719.596800744719 },
    { id: '2902579', latitude: 17.26684, longitude: 65.93072, temperature: 31.3736482734650, salinity: 36.6180447016848, pressure: 4.60000009536645, measurement_time: '2024-06-07T00:46:14', distance_km: 758.869001748704 },
    { id: '2902630', latitude: 14.629, longitude: 68.306, temperature: 31.6778866425853, salinity: 32.0449915600346, pressure: 4.19999942779437, measurement_time: '2024-06-07T14:39:36', distance_km: 774.889520143519 },
    { id: '1900070', latitude: 13.3166666666667, longitude: 64.6333333333334, temperature: 30.5700007623910, salinity: 36.3445822294773, pressure: 0, measurement_time: '2024-06-07T14:03:54', distance_km: 784.415522271360 }
  ];

  const stats = {
    activeFloats: 85,
    totalRecords: 27450,
    recentData: 27,
    avgTemperature: 28.7
  };

  const sampleQueries = [
    'SHOW FLOATS CLOSEST TO MUMBAI',
    'CREATE TEMPERATURE-SALINITY DIAGRAM',
    'SHOW FLOATS NEAR ARABIAN SEA',
    'SALINITY GREATER THAN 36'
  ];

  useEffect(() => {
    // Simulate API call - replace with actual backend call
    setFloats(mockFloats);
    setFilteredFloats(mockFloats);
  }, []);

  const executeQuery = (query) => {
    setLoading(true);
    setQueryInput(query);

    // Simulate API processing
    setTimeout(() => {
      if (query.toLowerCase().includes('mumbai')) {
        const sorted = [...mockFloats].sort((a, b) => a.distance_km - b.distance_km);
        setFilteredFloats(sorted.slice(0, 5));
      } else if (query.toLowerCase().includes('salinity greater than 36')) {
        const filtered = mockFloats.filter(f => f.salinity > 36);
        setFilteredFloats(filtered);
      } else if (query.toLowerCase().includes('arabian sea')) {
        const filtered = mockFloats.filter(f => f.longitude < 75 && f.latitude > 10);
        setFilteredFloats(filtered);
      } else {
        setFilteredFloats(mockFloats);
      }
      setLoading(false);
    }, 1000);
  };

  // Pagination logic
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = filteredFloats.slice(indexOfFirstItem, indexOfLastItem);
  const totalPages = Math.ceil(filteredFloats.length / itemsPerPage);

  const downloadCSV = () => {
    const headers = ['platform_number', 'latitude', 'longitude', 'temperature', 'salinity', 'pressure', 'measurement_time', 'distance_km'];
    const csvContent = [
      headers.join(','),
      ...filteredFloats.map(float => [
        float.id,
        float.latitude,
        float.longitude,
        float.temperature,
        float.salinity,
        float.pressure,
        float.measurement_time,
        float.distance_km
      ].join(','))
    ].join('\n');

    const blob = new Blob([csvContent], { type: 'text/csv' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'argo_floats_data.csv';
    a.click();
    window.URL.revokeObjectURL(url);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-600 via-blue-500 to-blue-400">
      {/* Top Stats Bar */}
      <div className="bg-yellow-400 px-6 py-2">
        <div className="grid grid-cols-4 gap-6 max-w-6xl mx-auto">
          <div className="bg-blue-600 rounded-lg p-3 text-white">
            <div className="text-xs text-blue-100">ACTIVE FLOATS</div>
            <div className="text-2xl font-bold">{stats.activeFloats}</div>
            <div className="text-xs text-blue-100">Currently deployed platforms</div>
          </div>
          <div className="bg-blue-600 rounded-lg p-3 text-white">
            <div className="text-xs text-blue-100">TOTAL RECORDS</div>
            <div className="text-2xl font-bold">{stats.totalRecords.toLocaleString()}</div>
            <div className="text-xs text-blue-100">Oceanographic measurements</div>
          </div>
          <div className="bg-blue-600 rounded-lg p-3 text-white">
            <div className="text-xs text-blue-100">RECENT DATA</div>
            <div className="text-2xl font-bold text-green-400">{stats.recentData}</div>
            <div className="text-xs text-blue-100">Last 24 hours</div>
          </div>
          <div className="bg-blue-600 rounded-lg p-3 text-white">
            <div className="text-xs text-blue-100">AVG TEMPERATURE</div>
            <div className="text-2xl font-bold">{stats.avgTemperature}Â°C</div>
            <div className="text-xs text-blue-100">Current ocean conditions</div>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="p-6">
        <div className="max-w-7xl mx-auto">
          {/* Header */}
          <div className="mb-6">
            <h1 className="text-2xl font-bold text-yellow-300 flex items-center">
              ðŸŸ¡ Global ARGO Float Network - 3D Visualization
            </h1>
          </div>

          <div className="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6">
            {/* Map Section */}
            <div className="lg:col-span-2 bg-slate-800 rounded-lg overflow-hidden">
              <div className="h-80 relative bg-gradient-to-b from-green-800 to-blue-900 flex items-center justify-center">
                {/* Simplified map representation */}
                <div className="absolute inset-0 bg-gradient-to-b from-green-700 to-blue-800"></div>
                {/* Mock coastline */}
                <div className="absolute bottom-0 right-0 w-32 h-24 bg-green-600 rounded-tl-full"></div>

                {/* Float markers */}
                {floats.slice(0, 8).map((float, index) => (
                  <div
                    key={float.id}
                    className="absolute w-3 h-3 bg-orange-400 rounded-full cursor-pointer hover:bg-yellow-400 transition-colors"
                    style={{
                      left: `${20 + index * 8}%`,
                      top: `${30 + (index % 3) * 15}%`
                    }}
                    onClick={() => setSelectedFloat(float)}
                    title={`Float ${float.id}`}
                  />
                ))}
              </div>
            </div>

            {/* AI Query Interface */}
            <div className="bg-slate-800 rounded-lg p-4">
              <h3 className="text-yellow-300 text-lg font-semibold mb-4">AI-Powered Query Interface</h3>

              {/* Query Input */}
              <div className="mb-4">
                <input
                  type="text"
                  value={queryInput}
                  onChange={(e) => setQueryInput(e.target.value)}
                  placeholder="Enter your query..."
                  className="w-full bg-slate-700 text-white p-3 rounded-lg border border-slate-600 focus:border-blue-400 focus:outline-none"
                  onKeyPress={(e) => e.key === 'Enter' && executeQuery(queryInput)}
                />
                <button
                  onClick={() => executeQuery(queryInput)}
                  disabled={loading}
                  className="w-full mt-2 bg-gray-700 hover:bg-gray-600 text-white p-2 rounded-lg flex items-center justify-center disabled:opacity-50"
                >
                  {loading ? (
                    <div className="animate-spin w-4 h-4 border-2 border-white border-t-transparent rounded-full mr-2"></div>
                  ) : (
                    <Search className="w-4 h-4 mr-2" />
                  )}
                  Execute Prompt
                </button>
              </div>

              {/* Sample Queries */}
              <div>
                <div className="text-white text-sm mb-2">Sample Queries:</div>
                <div className="space-y-2">
                  {sampleQueries.map((query, index) => (
                    <button
                      key={index}
                      onClick={() => executeQuery(query)}
                      className="w-full text-left bg-yellow-200 hover:bg-yellow-100 text-gray-800 p-2 rounded text-xs transition-colors"
                    >
                      {query}
                    </button>
                  ))}
                </div>
              </div>

              {/* AR Configuration */}
              <div className="mt-4 pt-4 border-t border-slate-600">
                <div className="text-yellow-300 text-sm flex items-center">
                  <Settings className="w-4 h-4 mr-2" />
                  ðŸ”§ AR Configuration
                </div>
              </div>
            </div>
          </div>

          {/* Results Section */}
          <div className="bg-slate-800 rounded-lg p-6">
            <h2 className="text-yellow-300 text-xl font-semibold mb-4">ðŸŸ¡ Query Results Data Table</h2>

            {/* Summary Stats */}
            <div className="grid grid-cols-3 gap-4 mb-6">
              <div>
                <div className="text-blue-300 text-sm">Records Found</div>
                <div className="text-white text-2xl font-bold">{filteredFloats.length}</div>
              </div>
              <div>
                <div className="text-blue-300 text-sm">Avg Temperature</div>
                <div className="text-white text-2xl font-bold">
                  {filteredFloats.length > 0 
                    ? (filteredFloats.reduce((sum, f) => sum + f.temperature, 0) / filteredFloats.length).toFixed(1)
                    : '0'
                  }Â°C
                </div>
              </div>
              <div>
                <div className="text-blue-300 text-sm">Unique Floats</div>
                <div className="text-white text-2xl font-bold">{filteredFloats.length}</div>
              </div>
            </div>

            {/* Data Table */}
            <div className="overflow-x-auto">
              <table className="w-full text-sm">
                <thead className="bg-slate-700">
                  <tr className="text-blue-300">
                    <th className="text-left p-3">platform_number</th>
                    <th className="text-left p-3">latitude</th>
                    <th className="text-left p-3">longitude</th>
                    <th className="text-left p-3">temperature</th>
                    <th className="text-left p-3">salinity</th>
                    <th className="text-left p-3">pressure</th>
                    <th className="text-left p-3">measurement_time</th>
                    <th className="text-left p-3">distance_km</th>
                  </tr>
                </thead>
                <tbody className="text-white">
                  {loading ? (
                    <tr>
                      <td colSpan={8} className="text-center p-6">
                        <div className="flex items-center justify-center">
                          <div className="animate-spin w-6 h-6 border-2 border-blue-400 border-t-transparent rounded-full mr-2"></div>
                          Loading data...
                        </div>
                      </td>
                    </tr>
                  ) : (
                    currentItems.map((float, index) => (
                      <tr key={float.id} className="border-b border-slate-700 hover:bg-slate-700/50">
                        <td className="p-3 font-mono">{float.id}</td>
                        <td className="p-3">{float.latitude.toFixed(6)}</td>
                        <td className="p-3">{float.longitude.toFixed(6)}</td>
                        <td className="p-3">{float.temperature.toFixed(6)}</td>
                        <td className="p-3">{float.salinity.toFixed(6)}</td>
                        <td className="p-3">{float.pressure.toFixed(6)}</td>
                        <td className="p-3">{float.measurement_time}</td>
                        <td className="p-3">{float.distance_km.toFixed(2)}</td>
                      </tr>
                    ))
                  )}
                </tbody>
              </table>
            </div>

            {/* Pagination */}
            <div className="flex justify-between items-center mt-4">
              <div className="text-white text-sm">
                {indexOfFirstItem + 1} to {Math.min(indexOfLastItem, filteredFloats.length)} of {filteredFloats.length}
              </div>
              <div className="flex space-x-2">
                <button
                  onClick={() => setCurrentPage(prev => Math.max(prev - 1, 1))}
                  disabled={currentPage === 1}
                  className="px-3 py-1 bg-slate-700 text-white rounded disabled:opacity-50"
                >
                  &lt;
                </button>
                <span className="px-3 py-1 bg-blue-600 text-white rounded">
                  Page {currentPage} of {totalPages}
                </span>
                <button
                  onClick={() => setCurrentPage(prev => Math.min(prev + 1, totalPages))}
                  disabled={currentPage === totalPages}
                  className="px-3 py-1 bg-slate-700 text-white rounded disabled:opacity-50"
                >
                  &gt;
                </button>
              </div>
            </div>

            {/* Download Button */}
            <div className="mt-6">
              <button
                onClick={downloadCSV}
                className="bg-yellow-400 hover:bg-yellow-300 text-gray-800 px-6 py-3 rounded-lg font-semibold flex items-center mx-auto transition-colors"
              >
                <Download className="w-5 h-5 mr-2" />
                ðŸ“Š DOWNLOAD RESULTS AS CSV
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App.js;
